let c = 45;

function draw(){
  document.documentElement.style.setProperty('--direction', c++ + 'deg');
  requestAnimationFrame(draw);
}

requestAnimationFrame(draw);
function OldNew() {
  return (
    <div className="OldNew">
      <main className="main">
        <div class="background OldNowDiv"></div>
        <div class="foreground OldNowDiv"></div>
      </main>
    </div>
  );
}
export default OldNew;
